If you read NY Mag’s extensive “rules” on how to live that recently came out you’ll see there was a nicely unhinged one about how you should post as many IGs as you want in one day to stick it to the algorithm. So that’s what I’m doing. 

While an interesting anti-rule, I was most taken by everyone’s very large-sized opinions about the tipping section. Why is it that the people who don’t understand how restaurants work are always the loudest on Instagram?

@tsujitala works by the churn. By 10ish years of being very quick and reasonably priced and delicious to the point that everyone was more than happy to stand huddled in the rain (most Angelenos melt in the rain, you see) for a table, on a recent visit. While their Tsukemen is the fave, I always love their ramen with fermented fish funky Thai chilis (level 2).
